/*Table structure for table `highQualityProject` */

DROP TABLE IF EXISTS `highQualityProject`;

CREATE TABLE `highQualityProject` (
  `id` varchar(32) NOT NULL COMMENT '优质项目表Id标识',
  `releaseType` varchar(64) DEFAULT NULL COMMENT '项目类型，如：代理，众筹',
  `industryChoice` varchar(255) DEFAULT NULL COMMENT '行业',
  `personalId` varchar(64) DEFAULT 'admin' COMMENT '个人资料id，也就是信息的发布者，默认admin',
  `title` varchar(128) DEFAULT NULL COMMENT '标题',
  `threshold` int(11) DEFAULT NULL COMMENT '起投金额，单位:万',
  `projectDescription` varchar(1024) DEFAULT NULL COMMENT '项目描述',
  `projectIntroduction` text COMMENT '项目介绍',
  `dockingPlan` text COMMENT '对接方案',
  `standardofJoining` text COMMENT '加盟标准',
  `financingScheme` text COMMENT '融资方案',
  `shareholderPrivileges` text COMMENT '股东特权',
  `riskHints` text COMMENT '风险提示',
  `maxApplyNumber` int(11) DEFAULT '1' COMMENT '每人一次最多可申请的份数',
  `imageArray` varchar(1024) DEFAULT NULL COMMENT '图片',
  `state` int(11) DEFAULT '0' COMMENT '状态',
  `cdate` datetime DEFAULT NULL COMMENT '创建时间',
  `mdate` datetime DEFAULT NULL COMMENT '最后修改时间',
  `creator` varchar(32) DEFAULT 'admin' COMMENT '创建人',
  `uman` varchar(32) DEFAULT 'admin' COMMENT '修改人',
  `df` int(11) DEFAULT '0' COMMENT '是否删除',
  `version` int(11) DEFAULT '0' COMMENT '数据版本',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `highQualityProject` */

