/*Table structure for table `highQualityProjectApply` */

DROP TABLE IF EXISTS `highQualityProjectApply`;

CREATE TABLE `highQualityProjectApply` (
  `id` varchar(32) NOT NULL COMMENT '优质项目申请表Id标识',
  `highQualityProjectId` varchar(32) NOT NULL COMMENT '优质项目Id',
  `personalId` varchar(32) DEFAULT NULL COMMENT '申请者id',
  `applyNumber` int(11) DEFAULT NULL COMMENT '申请份数',
  `amountofMoney` float DEFAULT NULL COMMENT '金额',
  `userName` varchar(32) DEFAULT NULL COMMENT '姓名',
  `phone` varchar(32) DEFAULT NULL COMMENT '电话',
  `userRemark` varchar(1024) DEFAULT NULL COMMENT '个人描述',
  `state` int(11) DEFAULT '0' COMMENT '状态, 0=众筹,1=加盟代理',
  `cdate` datetime DEFAULT NULL COMMENT '创建时间',
  `mdate` datetime DEFAULT NULL COMMENT '最后修改时间',
  `creator` varchar(32) DEFAULT NULL COMMENT '创建人',
  `uman` varchar(32) DEFAULT NULL COMMENT '修改人',
  `df` int(11) DEFAULT '0' COMMENT '是否删除',
  `version` int(11) DEFAULT '0' COMMENT '数据版本',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `highQualityProjectApply` */

LOCK TABLES `highQualityProjectApply` WRITE;

UNLOCK TABLES;

/*Table structure for table `notice` */

DROP TABLE IF EXISTS `notice`;

CREATE TABLE `notice` (
  `id` varchar(32) NOT NULL COMMENT '通知表id标识',
  `personalId` varchar(32) NOT NULL COMMENT '接收者，			比如: 零风id..',
  `releaseId` varchar(32) NOT NULL COMMENT '相关的发布信息id,		比如: 零风发布的信息id..',
  `imgUrl` varchar(255) NOT NULL COMMENT '信息图片url			比如: 发布信息对应的图片',
  `ntype` varchar(255) NOT NULL COMMENT '通知类型 0=系统通知,1=留言通知,2=私信通知',
  `content` varchar(255) NOT NULL COMMENT '通知内容,			比如: **谁谁给你评论..',
  `static` int(11) NOT NULL DEFAULT '0' COMMENT '通知状态			0=未查看，1=已查看,',
  `notifyname` varchar(255) DEFAULT NULL COMMENT '通知者名称				比如:搭伙小秘书，可以为空',
  `tile` varchar(255) DEFAULT NULL COMMENT '通知标题,					可以为空',
  `memo` varchar(255) DEFAULT NULL COMMENT '备注，					可以为空',
  `cdate` datetime DEFAULT NULL COMMENT '创建时间',
  `mdate` datetime DEFAULT NULL COMMENT '最后修改时间',
  `creator` varchar(32) DEFAULT NULL COMMENT '创建人(通知者:搭伙小秘书,零风id..)',
  `uman` varchar(32) DEFAULT NULL COMMENT '修改人',
  `df` int(11) DEFAULT '0' COMMENT '是否删除',
  `version` int(11) DEFAULT '0' COMMENT '数据版本',
  `avatarUrl` varchar(255) DEFAULT NULL COMMENT '头像',
  `infoType` varchar(255) DEFAULT NULL COMMENT '发布信息类型',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `notice` */

LOCK TABLES `notice` WRITE;

