/*Table structure for table `releaseinfo` */

DROP TABLE IF EXISTS `releaseinfo`;

CREATE TABLE `releaseinfo` (
  `id` varchar(32) NOT NULL COMMENT '发布信息Id标识',
  `releaseType` varchar(64) DEFAULT NULL COMMENT '发布类型',
  `personalId` varchar(64) DEFAULT NULL COMMENT '个人资料id，也就是信息的发布者',
  `title` varchar(128) DEFAULT NULL COMMENT '标题',
  `threshold` double(11,6) DEFAULT NULL COMMENT '入伙门槛，转让门槛,购入门槛，投资金额，加盟金额,需要金额，出售金额',
  `industryChoice` varchar(255) DEFAULT NULL COMMENT '行业选择',
  `fundDistribution` varchar(1024) DEFAULT NULL COMMENT '资金规划',
  `projectDescription` varchar(1024) DEFAULT NULL COMMENT '项目描述',
  `incomeDescription` varchar(1024) DEFAULT NULL COMMENT '收益描述',
  `teamIntroduction` varchar(255) DEFAULT NULL COMMENT '团队介绍(没有使用)',
  `phone` varchar(22) DEFAULT NULL COMMENT '联系方式',
  `imageArray` varchar(1024) DEFAULT NULL COMMENT '图片数组',
  `publisherIdentity` varchar(255) DEFAULT NULL COMMENT '发布人身份',
  `geographicalPosition` varchar(255) DEFAULT NULL COMMENT '地理位置',
  `operatingArea` varchar(255) DEFAULT NULL COMMENT '店铺面积,经营面积，项目面积',
  `monthlyRent` varchar(255) DEFAULT NULL COMMENT '每月租金',
  `businessDescription` varchar(1024) DEFAULT NULL COMMENT '经营描述,营业描述',
  `transferReason` varchar(1024) DEFAULT NULL COMMENT '转让原因',
  `throwInTheCity` varchar(255) DEFAULT NULL COMMENT '投放城市',
  `headquartersLocation` varchar(255) DEFAULT NULL COMMENT '总部位置',
  `resourceRequirements` varchar(1024) DEFAULT NULL COMMENT '技能/资源要求,能力要求',
  `shareDivision` varchar(255) DEFAULT NULL COMMENT '转让股份,股权配出,出售股份',
  `productType` varchar(255) DEFAULT NULL COMMENT '产品种类',
  `houseType` varchar(255) DEFAULT NULL COMMENT '房产类型',
  `projectAdvantage` varchar(255) DEFAULT NULL COMMENT '项目优势(没有使用)',
  `productCategory` varchar(255) DEFAULT NULL COMMENT '产品类目(没有使用)',
  `productHighlights` varchar(255) DEFAULT NULL COMMENT '产品亮点(没有使用)',
  `currentCity` varchar(255) DEFAULT NULL COMMENT '当前城市',
  `agentCondition` varchar(255) DEFAULT NULL COMMENT '代理条件(没有使用)',
  `agencyRule` varchar(255) DEFAULT NULL COMMENT '代理规则(没有使用)',
  `top` int(1) DEFAULT '0' COMMENT '置顶: 0=正常显示，1=官方，2=精品',
  `static` int(1) DEFAULT NULL COMMENT '状态=0是正常显示，1=已下架，2=未发布 4=正在审核，5审核未通过',
  `cdate` datetime DEFAULT NULL COMMENT '创建时间',
  `mdate` datetime DEFAULT NULL COMMENT '最后修改时间',
  `creator` varchar(32) DEFAULT NULL COMMENT '创建人',
  `uman` varchar(32) DEFAULT NULL COMMENT '修改人',
  `df` int(11) DEFAULT '0' COMMENT '是否删除',
  `version` int(11) DEFAULT '0' COMMENT '数据版本',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

